import React, { Component } from "react";
import * as d3 from 'd3';
import "./pie.css";

const data = [1, 2, 3, 4];

class Pie extends Component {
  render() {
    const height = 400;
    const width = 400;
    let pie = d3.pie()(data);
    return (
      <div class="col col-md-6">
        <div class="card">
          <svg height={height} width={width}>
            <g tranform={'translate(${width/2},${height/2})'}>
              <Slice pie={pie}/>
            </g>
          </svg>
        </div>
      </div>
    );
  }
}

export default Pie;
